import React from 'react'
import Tile from './Tile'


export default class Portfolio extends React.Component {
  constructor(){
    super()
    this.state = {
      projects: [
        {title: 'TTT', image: '../public/ttt.png', stats: 'no'},
        {title: 'EAF', image: '../public/eaf.png', stats: 'yes'},
        {title: 'Portfolio', image: '../public/website.png', stats: 'soso'}
      ]
    }
  }


  render() {
    return (
      <div className='grid'>
          {this.state.projects.map(project=>{
            // console.log(project.title)
           return <Tile projects = {{title: project.title, image: project.image, stats: project.stats }} />
          })}
      </div>
    )
  }
}
